  \"2014-05-02T20:06:42.921981\",\n\t\"name\": \"index-of-acquisition-dates-for-naip-digital-orthorectified-images-doq-minnesota-2008\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains lines and/or polygons
  delineating the boundary between DOQQ (digital orthophoto quarter quads) imagery
  used in the creation of compressed county mosaic (CCM). The DOQQ and CCM products
  were created from imagery acquired in the National Agriculture Imagery Program (NAIP).
  These boundary lines can be used as a tool in determining the image source and date
  of each portion of the CCM. The boundary lines separating each DOQQ may be the actual
  seam line location or an approximation. This is because the various vendors acquiring
  and processing the data use different algorithms to create the DOQQ and CCM products.
  Since the seam line may be an approximation, portions of the CCM along the boundary
  may actually come from the imagery on the other side of the seam line. NAIP acquires
  digital ortho imagery during the agricultural growing seasons in the continental
  U.S.. The tiling format of NAIP imagery is based on a 3.75 minute x 3.75 minute
  quarter quadrangle with a 300 meter buffer on all four sides. NAIP quarter quads
  are formatted to the UTM coordinate system using NAD83. --------------- Note: The
  Minnesota Geospatial Information Office (MnGeo) has modified the original metadata
  for this file from the Farm Service Agency's Aerial Photography Field Office to
  change fields such as the distributor. ---------------\",\n\t\"license_title\":
